import {FaBars, FaTimes} from 'react-icons/fa';

function Navbar(){
return(
    <header>
        <h3>Logo</h3>
        <nav>
            <a href="#">Home</a>
            <a href="#">My Work</a>
            <a href="#">Blog</a>
            <a href="#">About me</a>
            <button><FaTimes/></button>
        </nav>

        <button>
            <FaBars/>
        </button>
    </header>
)
}

export default Navbar;
